// src/App.js
import { Routes, Route, Link, useLocation } from "react-router-dom";
import Home from "./pages/Home";
import ProblemPage from "./pages/ProblemPage";
import Login from "./pages/Login";
import Register from "./pages/Register";
import MySubmissions from "./pages/MySubmissions";
import Profile from "./pages/Profile";
import { useAuth } from "./context/AuthContext";
import LandingPage from "./LandingPage";
import SimpleCodeEditor from "./components/SimpleCodeEditor";
import ContestsList from "./pages/ContestsList";
import ContestPage from "./pages/ContestPage";
import DuelPage from "./pages/DuelPage";
import TeamsPage from "./pages/TeamsPage";
import TeamBattlePage from "./pages/TeamBattlePage";
import CreateContest from "./pages/CreateContest";
import DuelRoomPage from "./pages/DuelRoomPage";
import CreateContestPage from "./pages/CreateContestPage";



function App() {
  const { user, logout } = useAuth();
  const location = useLocation();

  const isLanding = location.pathname === "/";
  const isSimpleEditor = location.pathname === "/simple-editor";

  return (
    <>
      {/* Neon header for all non-landing pages */}
      {!isLanding && (
        <header className="simple-header">
          <div className="header-container">
            {/* Logo */}
            <Link to="/" className="logo-link">
              <div className="logo">CodeGen4Future</div>
            </Link>

            {/* Main nav */}
            <nav className="simple-nav" style={{ gap: "0.5rem", flexWrap: "wrap" }}>
              {!isSimpleEditor && (
                <>
                  <Link to="/problems" className="nav-link">
                    Problems
                  </Link>
                  <Link to="/contests" className="nav-link">
                    Contests
                  </Link>
                  <Link to="/duel" className="nav-link">
                    1v1 Duel
                  </Link>
                  <Link to="/teams" className="nav-link">
                    Teams
                  </Link>
                  <Link to="/team-battle" className="nav-link">
                    Team Battle
                  </Link>
                  <Link to="/simple-editor" className="nav-link">
                    Simple Editor
                  </Link>
                </>
              )}

              {user ? (
                <>
                  <Link to="/submissions" className="nav-link">
                    My Submissions
                  </Link>
                  <Link to="/profile" className="nav-link">
                    Profile
                  </Link>
                  <span
                    style={{
                      color: "#cccccc",
                      fontSize: "0.9rem",
                      marginLeft: "0.5rem",
                    }}
                  >
                    Hi, {user.username}
                  </span>
                  <button
                    onClick={logout}
                    className="nav-link"
                    style={{
                      border: "2px solid rgba(255,107,107,0.5)",
                      background: "rgba(255,107,107,0.12)",
                    }}
                  >
                    Logout
                  </button>
                </>
              ) : (
                <>
                  <Link to="/login" className="nav-link">
                    Login
                  </Link>
                  <Link to="/register" className="nav-link">
                    Register
                  </Link>
                </>
              )}
            </nav>
          </div>
        </header>
      )}

      {/* Main content area â€“ uses same spacing as SimpleCodeEditor */}
      <main className={isLanding ? "" : "simple-main"}>
        <Routes>
          {/* Landing page */}
          <Route path="/" element={<LandingPage />} />

          {/* LeetCode clone problem list */}
          <Route path="/problems" element={<Home />} />

          {/* Problem details (also used for contest problems) */}
          <Route path="/problems/:slug" element={<ProblemPage />} />
          <Route
            path="/contests/:contestId/problems/:slug"
            element={<ProblemPage />}
          />

          {/* Simple standalone editor */}
          <Route path="/simple-editor" element={<SimpleCodeEditor />} />

          {/* Auth */}
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* User pages */}
          <Route path="/submissions" element={<MySubmissions />} />
          <Route path="/profile" element={<Profile />} />

          {/* Contests + matches */}
          <Route path="/contests" element={<ContestsList />} />
          <Route path="/contests/create" element={<CreateContest />} />
          <Route path="/contests/:id" element={<ContestPage />} />
          <Route path="/duel" element={<DuelPage />} />

          {/* Teams */}
          <Route path="/teams" element={<TeamsPage />} />
          <Route path="/team-battle" element={<TeamBattlePage />} />
          <Route path="/duel" element={<DuelPage />} />
          <Route path="/duel-room/:roomId" element={<DuelRoomPage />} />
          <Route path="/contests/new" element={<CreateContestPage />} />


        </Routes>
      </main>
    </>
  );
}

export default App;
